import './App.css';
import Navbar from "./components/Navbar"
import Card from "./components/Card"

function App() {
  return (
    <div className="App">
      <Navbar />
      <Card 
        img="./images/katie-zaferes.png"
        rating="5.0"
        reviewCount={6}
        country="USA"
        title="Life lessons with Katie Zaferes"
        price={136}
      />
    </div>
  );
}

export default App;
